	<script>

var angle=0;
var angle_delta=0.5;
var angle2 = 0;
var angle_delta2 = 0.5;
var rr=document.getElementById('Shape_IndexedFaceSet_001_TRANSFORM');
var r=document.getElementById('Shape_IndexedFaceSet_002_TRANSFORM');
function rotate_part_Rot()
{
if (flag_is_changed==1) {angle=angle+angle_delta; rr.setAttribute('rotation','0 1 0 '+angle+'');}
if (flag_is_changed==2) {angle=angle-angle_delta; rr.setAttribute('rotation','0 1 0 '+angle+'');}
}
function rotate_part()
{
if (flag_is_changed2==1) {angle2=angle2-angle_delta2; r.setAttribute('rotation','0 1 0 '+angle2+'');}
if (flag_is_changed2==2) {angle2=angle2+angle_delta2; r.setAttribute('rotation','0 1 0 '+angle2+'');}
}

//MOUSE START
function mouse_action(event)
{
var x1=event.clientX;
var y1=event.clientY;
if ((x1>=0)&&(x1<300))
{
flag_is_changed=1;
flag_is_changed2=1;
}
if ((x1>=300)&&(x1<600))
{
flag_is_changed=2;
flag_is_changed2=2;
}
rotate_part_Rot();
rotate_part();
}
//MOUSE END
function mouse_action_end(event)
{
flag_is_changed=0;
flag_is_changed2=0;
}

//TOUCH START
function touch_action(event)
{
var x1h = event.touches[0].clientX;
var y1h = event.touches[0].clientY;
if ((x1h>=0)&&(x1h<300))
{
flag_is_changed=1;
flag_is_changed2=1;
}
if ((x1h>=300)&&(x1h<600))
{
flag_is_changed=2;
flag_is_changed2=2;
}
rotate_part_Rot();
rotate_part();
}
function touch_action_end(event)
{
flag_is_changed=0;
flag_is_changed2=0;
}
//TOUCH END

// Handle MOUSE
document.getElementById('3d_object').addEventListener("mousedown", mouse_action, true);
document.getElementById('3d_object').addEventListener("mouseup", mouse_action_end, true);

// Handle TOUCH EVENTS
document.getElementById('3d_object').addEventListener("touchstart", touch_action, true); 
document.getElementById('3d_object').addEventListener("touchend", touch_action_end, true); 

// Handle KEYBOARD 
addEventListener("keydown", function (e) {
	if(e.keyCode==37) {flag_is_changed=1; rotate_part_Rot();}
	if(e.keyCode==39) {flag_is_changed=2; rotate_part_Rot();}
	if(e.keyCode==37) {flag_is_changed2=1; rotate_part();}

}, false);

	flag_is_changed=0;
	flag_is_changed2=0;
}, false);
